*** 1. create patients database

SELECT a.person_id, a.gender, a.age, b.postcode, c.claim_id, d.diagnosis_procedure_type, d.diagnosis_procedure_number, d.episode_id, e.icu_days, e.icu_hours, d.service_type, d.item_number,  c.service_date, d.create_datetime 
INTO [CBHS_Haohui].[dbo].[patients_records]
FROM [CBHS].[dbo].[person] as a
inner join [CBHS].[dbo].[claim_hospitalitem] as c on a.person_id=c.person_id
inner join [CBHS].[dbo].[episode_diagnosis_procedure] as d on c.episode_id=d.episode_id
left join [CBHS].[dbo].[episode] as e on d.episode_id=e.episode_id
left join [CBHS].[dbo].[address] as b on c.person_id=b.person_id 
order by person_id 

*** 2. select diabetes patients
SELECT a.person_id, a.gender, a.age, a.postcode, a.claim_id, a.diagnosis_procedure_type, a.diagnosis_procedure_number, a.episode_id, a.icu_days, a.icu_hours, a.service_type, a.item_number,  a.service_date, a.create_datetime 
INTO [CBHS_Haohui].[dbo].[Diabetes_patients_records]
FROM [CBHS_Haohui].[dbo].[patients_records] as a
Where item_number like 'E11%' or item_number like 'E10%' or item_number  like 'E12%' or item_number like 'E13%' or item_number like  'E14' or item_number = '25000' or item_number = '25001' or item_number = '25002' or item_number = '25003' or item_number = '25010' or item_number = '25011' or item_number = '25012' or item_number = '25013' or item_number = '25020' or item_number = '25021' or item_number = '25022' or item_number = '25023' or item_number = '25030' or item_number = '25031' or item_number = '25032' or item_number = '25033' or item_number = '25040' or item_number = '25041' or item_number = '25042' or item_number = '25043' or item_number = '25050' or item_number = '25051' or item_number = '25052' or item_number = '25053' or item_number = '25060' or item_number = '25061' or item_number = '25062' or item_number = '25063' or item_number = '25070' or item_number = '25071' or item_number = '25072' or item_number = '25073' or item_number = '25090' or item_number = '25091' or item_number = '25092' or item_number = '25093'
order by person_id

*** 3. select non-diabetes patients
SELECT distinct a.person_id FROM [CBHS_Haohui].[dbo].[patients_records] as a
INTO [CBHS_Haohui].[dbo].[Non_Diabetes_patients_records]
(
select b.person_id from [CBHS].[dbo].[Diabetes_Patients_History] as b

)
order by a.person_id

*** 4. select first diabete diagnosed date

SELECT distinct person_id, min(service_date) as diabetes_diagnosed_date 
Into [CBHS_Haohui].[dbo].[Diabetes_first_date]
FROM [CBHS_Haohui].[dbo].[patients_records]
where (item_number like 'E11%' or item_number='25000' or item_number='25002' or item_number='25010' or item_number='25012' or item_number='25020' or item_number='25022' or item_number='25030' or item_number='25032' or item_number='25040' or item_number='25042' or item_number='25050' or item_number='25052' or item_number='25060' or item_number='25062' or item_number='25070' or item_number='25072' or item_number='25080' or item_number='25082' or item_number='25090' or item_number='25092')
group by person_id
order by person_id

5. select disease before first diagnosed date
SELECT a.person_id, a.gender, a.age, a.postcode, a.claim_id, a.diagnosis_procedure_type, a.diagnosis_procedure_number, a.episode_id, a.icu_days, a.icu_hours, a.service_type, a.item_number,  a.service_date, a.create_datetime 
INTO [CBHS_Haohui].[dbo].[T2D_patients_records]
FROM [CBHS_Haohui].[dbo].[patients_records] as a
inner join [CBHS_Haohui].[dbo].[Diabetes_first_date] as c on a.person_id=c.person_id
where  a.service_date < c.diabetes_diagnosed_date

